import React from 'react'

function SavedDiseases({ bookmarks }) {
  return (
    <div>
        {bookmarks && bookmarks.map((bookmark) => (
            <h2>{ bookmark }</h2>
        ))}
    </div>
  )
}

export default SavedDiseases
